css:
.tree-view-resizer {
  transform: translate(0, 0);
}
.tree-view-resizer[data-autohide] {
  min-width: 0;
  z-index: 100;
  overflow: visible;
}
.tree-view-resizer[data-autohide][data-show-on-right-side="true"] {
  right: 0;
}
.tree-view-resizer[data-autohide] .tree-view {
  padding-right: 31px;
}
.tree-view-resizer[data-autohide] .list-tree {
  width: -webkit-min-content;
}
.tree-view-resizer[data-autohide] .tree-view-resize-handle {
  display: none;
}
.tree-view-resizer[data-autohide] .tree-view-autohide-trigger-area {
  height: 100%;
  width: 100%;
  position: absolute;
  top: 0;
  background-color: transparent;
  z-index: 5;
}
.tree-view-resizer[data-autohide][data-show-on-right-side="true"] .tree-view-autohide-trigger-area {
  right: 0;
}
.tree-view-resizer .tree-view-pin-button {
  position: fixed;
  top: 5px;
  right: 5px;
  max-width: calc(100% -  5px);
  overflow: hidden;
  color: transparent;
  -webkit-text-stroke: 1px #adaaa4;
  transform: rotateZ(30deg);
  transition: transform 100ms, color 100ms;
}
.tree-view-resizer .tree-view-pin-button:hover {
  color: #adaaa4;
}
.tree-view-resizer .tree-view-pin-button.active {
  color: #dddcda;
  -webkit-text-stroke: 0;
  transform: rotateZ(0);
}
.tree-view-resizer .tree-view-pin-button::before {
  margin: 0;
}
